import "./App.css";
import Products from "./component/Products";
import ProductRoutes from "./component/ProductRoutes";
import Form from "./component/Form";

function App() {
  return (
    <div className="App">
      <ProductRoutes />
      <Products />
      <Form />

       <BrowserRouter>
        <Routes>
          <Route path="/" element={<Form/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
